import React, { useState } from "react";
import Button from "@material-ui/core/Button";
import { NavLink } from "react-router-dom";
import AddResource from "./AddResource";

function FrontEnd() {
  const [open, setOpen] = useState(false);

  const handleClickToOpen = () => {
    setOpen(true);
  };

  const handleToClose = () => {
    setOpen(false);
  };

  return (
    <div className="row">
      <div className="col-xl-6 mb-4">
        <div className="card">
          <div className="card-body">
            <div className="d-flex justify-content-between align-items-center">
              <div className="d-flex align-items-center">
                <h2
                  style={{ width: "80px", height: "200px" }}
                  className="rounded-circle"
                >
                  WEEK 1 to 2
                </h2>
                <div className="ms-3">
                  <p className="fw-bold mb-1">React fundamentals and Hooks</p>
                </div>
              </div>
            </div>
          </div>
          <div class="card-footer border-0 bg-light p-2 d-flex justify-content-around">
            <div class="card-footer border-0 bg-light p-2 d-flex justify-content-around">
              <a
                class="btn btn-link m-0 text-reset"
                href="#"
                role="button"
                data-ripple-color="primary"
              >
                Add Resource<i class="fas fa-envelope ms-2"></i>
              </a>
              <a
                class="btn btn-link m-0 text-reset"
                href="#"
                role="button"
                data-ripple-color="primary"
              >
                View Resources<i class="fas fa-phone ms-2"></i>
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default FrontEnd;
